import React, { Component } from "react";
import SingleCard from "./SingleCard";
var bg = {
  background: "#FF9800",
  color: "white"
};

export class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {
      link: "",
      title: "One",
      details: "ddfault"
    };
  }
  render() {
    return (
      <div style={bg}>
        <div className="container text-primary text-center">
          <br />
          <h1>Rokkhi for Everyone</h1>
          <br />
          <div class="card-deck">
            <SingleCard
              details="This is a wider card with supporting text below as a natural
              lead-in to additional content. This content is a little bit
              longer."
              link="//www.gstatic.com/mobilesdk/160505_mobilesdk/discoverycards/2x/storage.png"
              title="//www.gstatic.com/mobilesdk/160505_mobilesdk/discoverycards/2x/storage.png"
            />
            <SingleCard />
            <SingleCard />
          </div>
        </div>
        <br />
      </div>
    );
  }
}

export default Card;
